const LOOK_AHEAD = 10;

function sum(y, x) {
    return y + x;
}

function add_hours(date, hours) {
    return new Date(
        date.getFullYear(),
        date.getMonth(),
        date.getDate(),
        date.getHours() + hours
    );
}

function date_id(date) {
    return [
        date.getFullYear(),
        date.getMonth() + 1,
        date.getDate(),
        date.getHours()
    ];
}

const trigger = add_hours(new Date(), 0);

const by_date = {};
for (const item of flow.get("nordpool")) {
    by_date[date_id(new Date(item.Timestamp))] = item.Price / 1000;
}

const prices = [];
for (let i = 0; i < LOOK_AHEAD; i++) {
    const id = date_id(add_hours(trigger, i));
    if (id in by_date) {
        prices[i] = by_date[id];
    }
}

let heating_cum_last;
const heating_cum_old = context.get("heating_cum");
if (heating_cum_old) {
    heating_cum_last = heating_cum_old[date_id(add_hours(trigger, -1))] || 0;
} else {
    heating_cum_last = 0;
}

const decrement_price = flow.get("decrement_price") || 1.0;

let heating = prices.map((p) => {return p * -1 / decrement_price});

const heating_cum = heating.reduce(sum, heating_cum_last);

heating = heating.map(h => {
    return h - heating_cum / heating.length;
});

const heating_now = Math.round(heating[0]);
const heating_cum_now = heating_cum_last + heating_now;
let heating_cum_new = {};
heating_cum_new[date_id(add_hours(trigger, -1))] = heating_cum_last;
heating_cum_new[date_id(trigger)] = heating_cum_now;

context.set("heating_cum", heating_cum_new);

node.warn({
    heating: heating,
    prices: prices,
    heating_now: heating_now
});

messages = [];

const timestamp = trigger.getTime();

messages[0] = {
    topic: "price",
    timestamp: timestamp,
    payload: prices[0]
};

messages[1] = {
    topic: "heating",
    timestamp: timestamp,
    payload: heating_now
};

messages[2] = {
    topic: "strategy",
    payload: [{
        "series": ["price", "heating"],
        "data": [
            prices.map((p, i) => {
                return {
                    x: add_hours(trigger, i).getTime(),
                    y: p
                };
            }),
            heating.map((h, i) => {
                return {
                    x: add_hours(trigger, i).getTime(),
                    y: h
                };
            })
        ],
        "labels": [""]
    }]
};

return messages;

const flags = {
    "pca-power-relays-ep14-43516": ["0", "1", "2", "3", "4"],
    "eb100-ep14-pca-base-relays-43514": ["compressor", "K3", "K2", "K1"]
}

for (let i = 0; i < flags[msg.topic].length; i++) {
    node.send({
        topic: msg.topic + "-" + flags[msg.topic][i],
        payload: (msg.payload & (1 << i)) != 0 ? 1 : 0
    });
}
